import React from 'react';
import './App.css';

function Experience() {
  return (
    <section id="experience" className="experience">
      <h2>Experience</h2>
      <ul>
        <li>
          <h3>Data Engineer - XYZ Corporation</h3>
          <p>Built data pipelines using Spark and Hadoop, optimized data flows for large-scale environments.</p>
        </li>
        <li>
          <h3>Data Analyst - ABC Analytics</h3>
          <p>Analyzed large datasets, built visualization tools to aid decision-making processes.</p>
        </li>
      </ul>
    </section>
  );
}

export default Experience;
